import React, { Component } from 'react';

import './TrailerVideo.css';

class TrailerVideo extends Component {
    render(){
        return(
            <div id='videoContainer'>
                <div id='videoContentContainer'>
                    <iframe width='100%' height='100%' allow='fullscreen;' src="https://www.youtube.com/embed/ZjJUVsmjIj4" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
                </div>
            </div>
        )
    }
}

export default TrailerVideo;
